Accounts_CustomFields_Description:
Требало би бити валидан ЈСОН гдје су кључеви имена поља која садрже речник за подешавања поља. Пример: <br/><code>{
"улога": {
"тип": "изаберите",
"дефаултВалуе": "студент",
"опције": ["наставник", "студент"],
"обавезно": тачно,
"модифиРецордФиелд": {
"арраи": труе,
"поље": "улога"
}
},
"твиттер": {
"тип": "текст",
"обавезно": тачно,
"минЛенгтх": 2,
"макЛенгтх": 10
}
} </code>

Custom_Translations_Description:
Требало би бити валидан ЈСОН гдје су кључеви језици који садрже кључни рјечник и преводе. Пример: <br/><code>{
"ср": {
"Канали": "Собе"
},
"пт": {
"Канали": "Салас"
}
} </code>
